import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'

const MainNavbar = () => {
    return (
        <Container fluid>
            <Row>
                <Col>Expense Management System</Col>
            </Row>
        </Container>
    )
}

export default MainNavbar
